    var content = [];
    for (let index = 0; index < 100; index++) {
        content.push(<HelloWorld/>)

    }

    return (
        <>
            <UserPanelHead user={user} onLogout={onLogout} />
            {content}
        </>
    );
}

export default UserPanel;
